def calculate_minimum_bytecoins(n, m, voters):
    nvot = [0] / (m + 1)
    party = [[] for _ in range(m + 1)]
    cos = {}
    cost = []
    for (p, c) in voters:
        if p != 1:
            if c in cos:
                cos[c] += 1
            else:
                cos[c] = 1
            cost.append(c)
        party[p].append(c)
        nvot[p] += 1
    cost.sort()
    for i in range(1, m + 1):
        party[i].sort()
    mi = float('inf')
    for x in range(1, n + 1):
        dcos = dict(cos)
        tmp = 0
        vot = nvot[1]
        for j in range(2, m + 1):
            if nvot[j] >= x:
                for k in range(nvot[j] - x + 1):
                    vot += 1
                    tmp += party[j][k]
                    dcos[party[j][k]] -= 1
        j = 0
        while vot < x:
            if dcos[cost[j]] > 0:
                dcos[cost[j]] -= 1
                tmp += cost[j]
                vot += 1
            j += 1
        mi = min(mi, tmp)
    return mi

